description:
This data shows where there are interconnections between public transportation modes at aiports, ferry, and intercity rail and bus stations in the United States.

More specifically, according to the Bureau of Transportation Statistics: 
&quot;The Intermodal Passenger Connectivity Database is a nationwide data table of passenger transportation terminals, with data on the availability of connections among the various scheduled public transportation modes at each facility. In addition to geographic data for each terminal, the data elements describe the availability of rail, air, bus, transit, and ferry services. This data has been collected from various public sources to provide the only nationwide measurement of the degree of connectivity available in the national passenger transportation system. At this point, data has been collected for intercity rail stations and airline airports only. Data on terminals of other modes is being collected and will be released when it is available. It is anticipated that the entire database will be complete by December 31, 2008.&quot;
